import React, { Component } from 'react';

class Titles extends Component {
	render () {
		return (
			<div>
				<h1 className="weather-title">Weather Finder</h1>
				<p className="weather-subtle">Find out Temperature, conditions and more...</p>
			</div>
		);
	}
}

export default Titles;
